import React from 'react';
import iso from '../../styles/scss/form.module.scss';
import wrap from '../../media/img/wallpaper.jpg';


const Inscription = () => {
  return (
    <section className="container wrap inscription" style={{backgroundImage:`url(${wrap})`}}>
      <form action="" className={`offset-2 col-8 `+iso.form}>
        <fieldset>
          <div className="row">
            <input type="text" placeholder="Indiquez votre Pseudo"/>
          </div>
          <div className="row">
            <input type="text" placeholder="Indiquez votre mail"/>
          </div>
          <div className="row">
            <input type="text" placeholder="Choisissez un mot de passe"/>
          </div>
          <button>
              Suivant
          </button>
        </fieldset>
      </form>
    </section>
  )
}

export default Inscription;
